%[text] # Two-photon microscopy data analysis
%[text] This notebook is designed to analyze data obtained from two-photon microscopy, specifically for the Cold Spring Harbor Laboratory (CSHL) Drosophila Neurobiology course.
%[text] The analysis will focus on various aspects of the collected data, including visualizing the volumes, registering the volumes, image processing, quantification of neuronal activity, and visualization of results.
%[text] The goal is to provide a short introduction to analyzing datasets obtained from two-photon microscopy. 
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Setup libraries and folder locations
%[text] Here I load the required libraries, setup the data folders, etc. 
% Set folder names
curr_folder = pwd;
repo_folder = fullfile(curr_folder, '..');
data_folder = fullfile(repo_folder, 'data');

% Dataset name
dataset_name = '20240706a_00004_00001.tif' %[output:5c394c3d]

% Load external libraries (that in in toolbox)
addpath(genpath(fullfile(pwd, 'toolbox/')));
%[text] ## Loading and visualizing datasets
%[text] In this section, we will load the dataset and visualize the volume as well as the linked metadata acquired during imaging. We will be using the scanimage library to load the tiff.
%[text] The below guide assumes that the two-photon microscope you are using saves the data as TIFF files (generally true as this is the default format).
%%
%[text] ### Load dataset
% Import Tiff Reader
import ScanImageTiffReader.ScanImageTiffReader;

% Setup reader to load dataset
reader = ScanImageTiffReader(fullfile(data_folder, dataset_name));

% Load dataset
volumes = reader.data(); % Load the volumes from the TIFF dataset
metadata = reader.metadata(); % Load metadata

%%
%[text] ### Visualizing images dataset
%[text] Volumes are stored as 3D arrays, i.e. a stack of images (like the ImageJ / Fiji visualization). The first two dimensions are the image resolution, the third dimension is number of such images that are acquired. They are technically not volumes as there is no information about the depth of acqusition for each image.
%[text] We can do some exploratory investigation by looking at the dimensions, the number of images in the stack and visualize individual images.
% Learn more about the volumes
disp(['Size of volumes: ', num2str(size(volumes))]); %[output:5a143226]
image_count = size(volumes, 3);
image_selection = image_count/500; % variable for the slider step
disp(['Number of images in volumes: ', num2str(image_count)]) %[output:0deefd8f]
% Show the first image in the stack with automatic grayscale scaling and magnify it (128x128 is too small)
imshow(volumes(:, :, 1), [], "InitialMagnification", 500);  %[output:3afda7ea]
% Display image based on a slide location
curr_ind=7; %[control:slider:3856]{"position":[10,11]}
imshow(volumes(:, :, curr_ind), [], "InitialMagnification", 500); %[output:82c40d25]
%[text] %[text:anchor:TMP_0768] **Task:** Move the slide and visualize how the images look at locations 16, 17 and 33, 34. What do you find?
%%
%[text] ### Interpretting metadata saved with dataset
%[text] The Tiff file essentially gives a stack of images. To make sense of volumes from it, we need to read the metadata that is saved along with the diff file. 
%[text] Using the metadata properly is tricky as it needs to be properly formatted as a variable - for now, let us just see the metadata. In addition to looking at the first few lines of the metadata below, double click the variable from the workspace and look at it a bit more.
metadata_lines = splitlines(metadata) %[output:08b77997]
%[text] To make sense of the Tiff file, we need to know the number of Z-stacks in each volume, and the number of volumes in our dataset. Additionally, during two-photon imaging flyback frames are sometimes saved as blank frames (the visualized 16, 17, 33, 34). We need to ignore them when processing our dataset. All this data can be found in the metadata.
%[text] Before we look into the metadata for this information, let's format the metadata for ease of access.
% Using a custom function to format the metadata
f_meta = formatScanImageTiffMetadata(metadata) %[output:21491114]
%[text] 
%[text] Details about the volume information can be found in hStackManager
% Pull out relevant metadata from the hStackManager
num_slices = f_meta.hStackManager.numFramesPerVolume;
num_total_slices = f_meta.hStackManager.numFramesPerVolumeWithFlyback;
frame_z_values = f_meta.hStackManager.zs;  
num_volumes = size(volumes,3) / num_total_slices;

% Print values
disp(['Total volumes: ', num2str(num_volumes)]) %[output:2ee37e44]
disp(['Number of "Data" slices per volume: ', num2str(num_slices)]) %[output:59712c50]
disp(['Total slices per volume (including "blanks): ', num2str(num_total_slices)]) %[output:6fbfdc18]
disp(['Z values for data slices: ', num2str(frame_z_values)]) %[output:0c063a27]
% Browse hStackManager and see the other metadata stored
f_meta.hStackManager %[output:53fa54d6]
%%
%[text] ## Processing calcium activity
%[text] Now that we know the number volumes and the slices per volume (as well as blank frames), we can being to process calcium activity seen in the dataset. 
%[text] There are multiple ways of doing this. For this analysis, we will assume that the neurons of our interest are localized on one plane/slice - we will call this the Slice of Interest (SOI). Here, we assume the 7th slice in the volume contains the neurons of interest (you can change this below). 
%[text] To compute calcium activity, we will do the following:
%[text] 1. Visualize the average activity of the SOI.
%[text] 2. Define an Region of Interest (ROI) for the Slice of Interest (SOI).
%[text] 3. Find the average fluorescence of in the ROIs for every SOI in our volumes. \
%[text] ### Compute average SOI
%[text] To process calcium activity, we first need to define a Region of Interest (ROI) for the Slice of Interest (SOI) per volume. We could do this the following ways:
%[text] - draw the ROI every slice manually - but that is too much effort (10000 frames in this dataset). 
%[text] - draw the ROI for the SOI first volume the use the same ROI to compute activity for SOIs in other volumes.
%[text] - draw the ROI on the average activity of SOIs in all volume, then use the ROI to compute activity in SOIs of all volumes. \
%[text] It is easy to see distinct neurons/groups of neurons in the average SOI, so we will use this method here.
%[text] To compute the average, the main computation we need to do is pull out our SOIs for every volume. From the metadata, we know the number of volumes and the total number of slices per volume. Using this we can easily pull out SOIs for all our volumes. We will then compute the mean and display the average SOI.
neuron_slice = 7; % try experimenting with different values

% extract SOIs
SOIs = extractSOIs(volumes, neuron_slice, num_total_slices);

% Compute mean (along the third /stack dimension)
mean_SOI = mean(SOIs, 3);

% Display meanSOI
imshow(mean_SOI,[], "InitialMagnification", 500);  %[output:90605c58]
%[text] %[text:anchor:TMP_0170] Now we can see the regions of activity much better. For slice 7 in the volume, there are 4 activity regions. Let's capture them using 4 ROIs.
%%
%[text] ### Defining ROIs
%[text] There are multiple ways of defining ROIs. For this example, we will use the drawpolygon function, which is the easiest for our purposes.
%[text] We will draw four ROIs on the image using the following code:
num_roi = 4;
h = figure('Position', [0, 0, 800, 600]); %[output:9893bef7]
imshow(mean_SOI,[], "InitialMagnification", 500, 'Parent', gca); %[output:9893bef7]
roi = cell(num_roi, 1); % Cell structure to save all our ROIs
for i=1:num_roi %[output:group:5000a39d]
    poly = drawpolygon; %[output:9893bef7]
    roi{i} = poly.Position;
end %[output:group:5000a39d]
%%
%[text] ### Computing fluorescence 
%[text] Once the ROI is defined, the have to define what the mean by fluorescence activity in the ROI. Typically, this is defined as the average signal in the ROI but one can define it in other ways, like sum of all activity in the ROI. Here, we will define fluorescence as average activity.
%[text] For each slice, we will select all the pixels in the ROI, compute the average. So for each ROI, we will have one value of every volume.
fluorescence = zeros(num_volumes, num_roi);

for i=1:num_roi

    % Pick an ROI
    curr_roi = round(roi{i});

    % Go through each volume and compute the average fluoroscence
    for j=1:num_volumes

        curr_slice = SOIs(:,:,j);
        fluorescence(j, i) = mean(curr_slice(curr_roi), "all");
    
    end

end
%[text] Now, let's plot them and see it looks.
plot(fluorescence) %[output:87e74083]
xlabel("Volumes / Time") %[output:87e74083]
ylabel("Fluorescence") %[output:87e74083]
